({ level, children }) => {
  const levelSize =
    level === 1
      ? "text-3xl"
      : level === 2
      ? "text-2xl"
      : level === 3
      ? "text-xl"
      : level === 4
      ? "text-lg"
      : level === 5
      ? "text-md"
      : level === 6
      ? "text-sm"
      : "text-xs";
  // {...props
  return (
    <Div id={getImplicitId(String(children))} className={levelSize}>
      {children}
    </Div>
  );
}
